import React from 'react';
import styled from 'styled-components';

const NodeContainer = styled.div`
  position: absolute;
  width: 30px;
  height: 30px;
  background: #007bff;
  border-radius: 50%;
  color: white;
  display: flex;
  align-items: center;
  justify-content: center;
  font-size: 14px;
  left: ${(props) => props.x || '50%'};
  top: ${(props) => props.y || '50%'};
`;

function Node({ node }) {
  const x = Math.random() * 400;
  const y = Math.random() * 400;

  return <NodeContainer x={`${x}px`} y={`${y}px`}>{node.id}</NodeContainer>;
}

export default Node;
